import React from "react";
import { Button } from "react-bootstrap";

const Home: React.FC = () => {

    return <div className="text-center">
                <br />
                <h1> Cadastre aqui seus produtos </h1>
                <br />
                <div>
                    <Button variant="primary" size="lg" active>
                        Cadastre seu produto
                    </Button>
                </div>
            </div>

}

export default Home;
